import React from 'react';
import "../App.css"
import './Me.css'

function Me() {
  return (
    <div className="about-container">
        <h1>About Me:</h1>
        <p>I'm a 19-year-old 2nd year student at Dominican University of California studying back-end web development</p>
        <p>I have experience working with front-end frameworks like react and bootstrap,  </p>
        <p>Aside from technology, growing up with many musicians in the family has inspired my love for regional mexican music and jazz</p>
    </div>
  )
}

export default Me;
